            <section className="card__content">
                <h3 className="book__name">{title}</h3>
                <span className="book__author" id="book__author">{book.author}</span>
            </section>
            <section className="prise__view">
                <span className="prise__content">{book.price} $</span>
                <button type="submit" className="view_btn">View</button>
            </section>
        </div>
     );
}

export default Card;
